import React from "react";

const SignUpPage = () => {
  const handleSignUp = () => {
    // Handle sign up logic
  };

  return (
    <div style={{ textAlign: "center" }}>
      <link rel="stylesheet" href="style.css" />
      <h4
        style={{ textAlign: "left", fontFamily: "Trirong", fontWeight: "bold" }}
      >
        SIGN UP
        <img
          src="lookkai.png"
          alt="Lookkai"
          width="100"
          height="100"
          style={{ float: "right" }}
        />
      </h4>
      <h5 style={{ textAlign: "left", fontFamily: "Trirong" }}>
        Already a member?{" "}
        <a
          href="U1_SignIn.html"
          style={{ color: "blue", textDecoration: "underline" }}
        >
          Sign in
        </a>
      </h5>
      <br />
      <br />
      <h4 style={{ textAlign: "left", fontFamily: "Trirong" }}>
        <b>Email</b>
      </h4>
      <div className="box2">
        <input type="text" placeholder="ex.xyz@gmail.com" />
        <br />
        <h4 style={{ textAlign: "left", fontFamily: "Trirong" }}>
          <b>Password</b>
        </h4>
        <input type="password" id="password" placeholder="Password" />
      </div>
      <br />
      <input
        type="submit"
        onClick={handleSignUp}
        value="Sign up"
        className="button-signUp"
      />
    </div>
  );
};

export default SignUpPage;
